export default function costingsReducer(state = initialState, actions) {
  switch (actions.type) {
    case costingsActions.SET_CURRENT_PROFILES: {
      return {
        ...state,
        costingProfiles: actions.costingProfiles,
      };
    }
    case costingsActions.CLEAR_ALL_COSTINGS:
      return {
        ...state,
        costingProfiles: [],
      };
    default:
      return state;
  }
}
